port 1338

pidfile /var/run/sessions.pid
dir ./

# should never exist
dbfilename sessions.rdb
# should never exist
appendfilename sessions.aof

databases 1

daemonize no

timeout 300
loglevel warning
logfile stdout

appendonly no

auto-aof-rewrite-percentage 0
auto-aof-rewrite-min-size 6400mb

requirepass 